import React from "react";
import logo from "../images/logo.svg";
import "../App.css";
const Anasayfa = () => {
  return (
    <div>
      <section>
        <div>
          <img className="logo" src={logo} alt="logo" />
        </div>

        <h1 className="metin">
          KOD ACIKTIRIR <br></br>PIZZA, DOYURUR
        </h1>

        <nav>
          <a href="/siparisForm" className="button">
            ACIKTIM
          </a>
        </nav>
      </section>
    </div>
  );
};
export default Anasayfa;
